define({"topics":[{"title":"Send <span class=\"ph\"><span class=\"ph uicontrol\">Airwall Invitations<\/span><\/span>","shortdesc":"<p class=\"shortdesc\">You send <span class=\"ph\"><span class=\"ph uicontrol\">Airwall Invitations<\/span><\/span> to         invite people to connect to your <span class=\"ph\">Airwall secure network<\/span>.         It can be as simple as sending the invitations to a list of email addresses. With a bit of         preparation, though, you can also automatically set up device access and trust as people         connect their devices.<\/p>","href":"content\/topics\/invite_send_airwall_invitations.html","attributes":{"data-id":"invite_send_airwall_invitations"},"menu":{"hasChildren":false},"tocID":"invite_send_airwall_invitations-d8884e2259","topics":[]},{"title":"Resend an Invitation","shortdesc":"<p class=\"shortdesc\">If you’ve sent an invitation and the person hasn’t received it, or their invitation         has expired before they activated it, you can resend it by using the original invitation as         a template to create a new invitation. See <a class=\"xref\" href=\"content\/topics\/invite_reuse_an_invitation.html\">content\/topics\/invite_reuse_an_invitation.html<\/a> to         send a new invitation with a new expiration date.<\/p>","href":"content\/topics\/invite_resend_an_invitation.html","attributes":{"data-id":"invite_resend_an_invitation"},"menu":{"hasChildren":false},"tocID":"invite_resend_an_invitation-d8884e2280","topics":[]},{"title":"Disable an Invitation","shortdesc":"<p class=\"shortdesc\">If you’ve sent an invitation and no longer want the person to be able to activate it,         you can disable it.<\/p>","href":"content\/topics\/invite_disable_an_invitation.html","attributes":{"data-id":"invite_disable_an_invitation"},"menu":{"hasChildren":false},"tocID":"invite_disable_an_invitation-d8884e2293","topics":[]},{"title":"Reuse an Invitation","shortdesc":"<p class=\"shortdesc\">If you have already created an invitation with the options needed for a new         invitation, you can easily reuse it. Some of the information for the invitation will be         already filled in.<\/p>","href":"content\/topics\/invite_reuse_an_invitation.html","attributes":{"data-id":"invite_reuse_an_invitation"},"menu":{"hasChildren":false},"tocID":"invite_reuse_an_invitation-d8884e2304","topics":[]},{"title":"Walkthrough – Send Expiring Guest Access Invitations","shortdesc":"<p class=\"shortdesc\">In this walkthrough, you set up and send  <span class=\"ph\"><span class=\"ph uicontrol\">Airwall Invitations<\/span><\/span> that provide guests         with 4 hours of access to your <span class=\"ph\">Airwall<\/span> secure network,         after which it automatically disables all communications.<\/p>","href":"content\/topics\/invite_walkthrough_send_expiring_guest_access_invitations.html#invite_walkthrough____send_expiring_guest_access_invitations","attributes":{"data-id":"invite_walkthrough____send_expiring_guest_access_invitations"},"menu":{"hasChildren":false},"tocID":"invite_walkthrough____send_expiring_guest_access_invitations-d8884e2315","next":"invite_walkthrough____send_expiring_guest_access_invitations-d8884e2315"}]});